INSERT INTO `card` VALUES (77,33,'Xây dựng database','<h3><em>Tạo Database</em><img src=\"data:image/png;base64,\" style=\"font-size: 13px;\"></h3>',NULL,'13',NULL,NULL,NULL,NULL),(78,34,'Viết các thủ tục',NULL,NULL,'13','2024-12-20 17:51:09','2024-12-27 00:00:00','2024-12-27 00:00:00',NULL),(79,34,'Tìm hiểu công nghệ để thực hiện','<h2><em>Công nghệ sử dụng cho frontend:</em></h2><ul><li>Kéo thả : <a href=\"https://dndkit.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--ds-link, #0c66e4);\">https://dndkit.com/</a></li><li>Giao diện: antd, scss module</li></ul><h2><em>Công nghệ sử dụng cho backend:</em></h2><ul><li>RealTime: <a href=\"http://socket.io/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--ds-link, #0c66e4);\">socket.io</a> ( cân nhắc )</li><li>File: multer, fs, clouldinary</li></ul><p><br></p>',NULL,'13,15','2024-12-20 17:51:17','2024-12-25 00:00:00','2024-12-24 23:50:00',NULL),(80,33,'Tìm hiểu các website quản lý cộng việc hiện có','<p><strong>Nghiên cứu &amp; Tìm hiểu</strong></p><p>Tìm hiểu và nghiên cứu các website quản lý xem các website đó có các ưu nhược điểm gì. Liệt kê các chức năng tiêu biểu của các website đó, xem và ứng dụng các chức năng đó vào đồ án 4</p><p><br></p><p><strong>Một số chức năng tiêu biểu:</strong></p><p><em>Trello:</em></p><ul><li>Giao diện ổn, dễ sử dụng</li><li>Quản lý công việc dưới dạng các bảng, và trong mỗi bảng có các task có thể tùy chỉnh kéo thả task và bảng</li><li>Set time, hẹn giờ, cài đặt thông báo</li><li>Tạo nhãn, thêm màu sắc, tạo nền cho phong phú</li></ul><p><br></p><p><em>ClickUp:</em></p><ul><li>Tạo Notepad</li><li>Quản lý công việc bằng các cột, trong các cột chức các task công việc và chỉ có thể kéo thả các task sang các cột khác nhau chứ không thay đổi được vị trí của cột</li><li>Có nhiều chế độ để xem quản lý công việc như: Board, List, Calendar, Gantt, Table</li><li>Ứng dụng thêm AI chatbox</li><li>Có chức năng quay màn hình</li><li>Có thể xuất file quản lý công việc với dạng Gantt</li><li>Set time, hẹn giờ, cài đặt thông báo</li></ul><p><br></p>',NULL,'13,15',NULL,NULL,NULL,NULL),(81,33,'Phác thảo giao diện','<h2><em>Giao diện bảng:</em></h2><p><img src=\"data:image/png;base64,\"></p>',NULL,'13',NULL,NULL,NULL,NULL),(82,31,'Phác thảo ra các chức năng',NULL,NULL,'13',NULL,NULL,NULL,NULL),(83,34,'Code API','<h1><em><u>Các API hiện có:</u></em></h1><p><img src=\"data:image/png;base64,\"></p>',NULL,'13','2024-12-05 00:00:00','2024-12-12 00:00:00',NULL,NULL),(87,34,'Code giao diện','<h2>Code giao diện</h2>',NULL,'13,15','2024-10-01 00:00:00','2024-12-04 00:00:00',NULL,NULL),(112,31,'Nghiên cứu thêm các chức năng mới',NULL,NULL,'',NULL,NULL,NULL,NULL);
