			) AS sorted_columns
		) AS `column`,
		(SELECT JSON_ARRAYAGG(
               JSON_OBJECT(
                   'user_id', g.user_id, 
                   'name', u.name,
                   'email', u.email,
                   'avatar', u.avatar,
                   'status', u.status,
                   'role', g.role
				   )
			   ) 
		 FROM `guest` g
		 LEFT JOIN `user` u ON g.user_id = u.user_id
		 WHERE g.board_id = b.board_id
		) AS `guest`
	FROM 
		`board` b
	WHERE 
		b.board_id = p_board_id;
	commit;
end ;;
DELIMITER ;
