CREATE DEFINER=`root`@`localhost` PROCEDURE `GetCardByID`(
    in p_card_id int,
    out p_error_code int,
    out p_error_message varchar(500)
)
begin
    declare exit handler for sqlexception
    begin
        get diagnostics condition 1 p_error_code = returned_sqlstate, p_error_message = message_text;
    end;
    set p_error_code = 0;
    set p_error_message = '';
    start transaction;

    SELECT 
		col.name as 'column_name',
        cd.card_id, 
        cd.column_id, 
        cd.name, 
        cd.description, 
        cd.background, 
        cd.user_id_join, 
        cd.start_date, 
        cd.end_date, 
        cd.timer, 
        cd.status,
        (SELECT JSON_ARRAYAGG(
			   JSON_OBJECT(
				   'user_id', u.user_id, 
				   'name', u.name,
				   'email', u.email,
				   'avatar', u.avatar
				   )
			) 
		 FROM `user` u
		 WHERE FIND_IN_SET(u.user_id, (SELECT user_id_join FROM `card` WHERE card_id = p_card_id)) > 0
		 ) AS 'userjoin',
        IF(
            COUNT(cln.checklistname_id) = 0,
            JSON_ARRAY(),
            JSON_ARRAYAGG(
                JSON_OBJECT(
                    'checklistname_id', cln.checklistname_id,
                    'name', cln.name,
                    'checklist', 
                    IF(
                        (SELECT COUNT(*) FROM `checklist` cl WHERE cl.checklistname_id = cln.checklistname_id) = 0,
                        JSON_ARRAY(),
                        (
                            SELECT 
                                JSON_ARRAYAGG(
                                    JSON_OBJECT(
                                        'checklist_id', cl.checklist_id,
                                        'user_id', cl.user_id,
                                        'name', cl.name,
                                        'timer', cl.timer,
                                        'status', cl.status
                                    )
                                )
                            FROM `checklist` cl 
                            WHERE cl.checklistname_id = cln.checklistname_id
                        )
                    )
                )
            )
        ) AS `checklistname`,
        IF(
            COUNT(cm.comment_id) = 0,
            JSON_ARRAY(),
            JSON_ARRAYAGG(
                JSON_OBJECT(
                    'comment_id', cm.comment_id,
                    'user_id', cm.user_id,
                    'comment', cm.comment,
                    'status', cm.status
                )
            )
        ) AS `comment`,
        IF(
            COUNT(f.file_id) = 0,
            JSON_ARRAY(),
            JSON_ARRAYAGG(
                JSON_OBJECT(
					'file_id', f.file_id,
                    'user_id', f.user_id,
                    'path', f.path
                )
            )
        ) AS `file`,
        IF(
            COUNT(l.card_id AND l.board_id) = 0,
            JSON_ARRAY(),
            JSON_ARRAYAGG(
                JSON_OBJECT(
                    'name', l.name,
                    'background', l.background
                )
            )
        ) AS `label`
    FROM 
        `card` cd
    LEFT JOIN `checklistname` cln ON cd.card_id = cln.card_id
    LEFT JOIN `comment` cm ON cd.card_id = cm.card_id
    LEFT JOIN `file` f ON cd.card_id = f.card_id
    LEFT JOIN `label` l ON cd.card_id = l.card_id
    LEFT JOIN `column` col on cd.column_id = col.column_id
    WHERE 
        cd.card_id = p_card_id
    GROUP BY 
		col.name,
        cd.card_id, 
        cd.column_id, 
        cd.name, 
        cd.description, 
        cd.background, 
        cd.user_id_join, 
        cd.start_date, 
        cd.end_date, 
        cd.timer, 
        cd.status;
    commit;
end ;;
DELIMITER ;
