CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateColumnWhenMoveCard`(
in p_column_id int,
in p_card_id int,
in p_card_id_order_new longtext,
in p_card_id_order_old longtext,
out p_error_code int,
out p_error_message varchar(500)
)
begin
